        self.label_55.setText(_translate("topicLessonMainWindow", "<html><head/><body><p>If the equation of the hyperbola is the form ( <span style=\" color:#ff0000;\">Note</span>: +/- means plus or minus, positive or negative ): </p><p align=\"center\"><span style=\" font-size:18pt; text-decoration: underline;\">( </span><span style=\" font-size:18pt; font-style:italic; text-decoration: underline;\">x</span><span style=\" font-size:18pt; text-decoration: underline;\"> - </span><span style=\" font-size:18pt; font-style:italic; text-decoration: underline; color:#00da00;\">h </span><span style=\" font-size:18pt; text-decoration: underline;\">)</span><span style=\" font-size:18pt; font-weight:600; text-decoration: underline; vertical-align:super;\">2</span><span style=\" font-size:18pt;\">-</span><span style=\" font-size:18pt; font-style:italic; text-decoration: underline;\">( y</span><span style=\" font-size:18pt; text-decoration: underline;\"> - </span><span style=\" font-size:18pt; font-style:italic; text-decoration: underline; color:#0000ff;\">k </span><span style=\" font-size:18pt; text-decoration: underline;\">)</span><span style=\" font-size:18pt; font-weight:600; text-decoration: underline; vertical-align:super;\">2</span><span style=\" font-size:18pt;\">= 1</span></p><p align=\"center\"><span style=\" font-size:18pt; color:#ffffff;\">q</span><span style=\" font-size:18pt;\">a</span><span style=\" font-size:18pt; font-weight:600; vertical-align:super;\">2</span><span style=\" font-size:18pt; font-weight:600; color:#ffffff; vertical-align:super;\">qqqqqqq</span><span style=\" font-size:18pt;\">b</span><span style=\" font-size:18pt; font-weight:600; vertical-align:super;\">2</span><span style=\" font-size:18pt; font-weight:600; color:#ffffff; vertical-align:super;\">qqqq</span></p><p>The center is ( <span style=\" font-style:italic; color:#00da00;\">h</span> , <span style=\" font-style:italic; color:#0000ff;\">k </span>) and its transverse axis is parallel to the <span style=\" font-style:italic; text-decoration: underline; color:#ff0000;\">x-axis</span>. </p><p>The vertices are located at ( <span style=\" font-style:italic; color:#00da00;\">h</span> +/- <span style=\" font-style:italic;\">a </span>, <span style=\" font-style:italic; color:#0000ff;\">k </span>)</p><p>The foci are the points ( <span style=\" font-style:italic; color:#00da00;\">h</span> +/- <span style=\" font-style:italic;\">c </span>, <span style=\" font-style:italic; color:#0000ff;\">k </span>)</p><p>The Endpoints of its Conjugate axis are ( <span style=\" font-style:italic; color:#00da00;\">h</span>, <span style=\" font-style:italic; color:#0000ff;\">k </span>+/- <span style=\" font-style:italic;\">b </span>) <br/><br/></p><p>If the equation of the ellipse is the form ( <span style=\" color:#ff0000;\">Note</span>: +/- means plus or minus, positive or negative ):</p><p align=\"center\"><span style=\" font-size:18pt; text-decoration: underline;\">( </span><span style=\" font-size:18pt; font-style:italic; text-decoration: underline;\">y</span><span style=\" font-size:18pt; text-decoration: underline;\"> - </span><span style=\" font-size:18pt; font-style:italic; text-decoration: underline; color:#0000ff;\">k </span><span style=\" font-size:18pt; text-decoration: underline;\">)</span><span style=\" font-size:18pt; font-weight:600; text-decoration: underline; vertical-align:super;\">2</span><span style=\" font-size:18pt;\">-</span><span style=\" font-size:18pt; font-style:italic; text-decoration: underline;\">( x</span><span style=\" font-size:18pt; text-decoration: underline;\"> - </span><span style=\" font-size:18pt; font-style:italic; text-decoration: underline; color:#00da00;\">h </span><span style=\" font-size:18pt; text-decoration: underline;\">)</span><span style=\" font-size:18pt; font-weight:600; text-decoration: underline; vertical-align:super;\">2</span><span style=\" font-size:18pt;\">= 1</span></p><p align=\"center\"><span style=\" font-size:18pt; color:#ffffff;\">q</span><span style=\" font-size:18pt;\">a</span><span style=\" font-size:18pt; font-weight:600; vertical-align:super;\">2</span><span style=\" font-size:18pt; font-weight:600; color:#ffffff; vertical-align:super;\">qqaqqqqq</span><span style=\" font-size:18pt;\">b</span><span style=\" font-size:18pt; font-weight:600; vertical-align:super;\">2</span><span style=\" font-size:18pt; font-weight:600; color:#ffffff; vertical-align:super;\">qaaaa</span></p><p>The center is ( <span style=\" font-style:italic; color:#00da00;\">h</span> , <span style=\" font-style:italic; color:#0000ff;\">k </span>) and its transverse axis is parallel to the <span style=\" font-style:italic; text-decoration: underline; color:#ff0000;\">y-axis</span>. </p><p>The vertices are located ( <span style=\" font-style:italic; color:#00da00;\">h</span>, <span style=\" font-style:italic; color:#0000ff;\">k </span>+/- <span style=\" font-style:italic;\">a </span>)</p><p>The foci are the points ( <span style=\" font-style:italic; color:#00da00;\">h</span>, <span style=\" font-style:italic; color:#0000ff;\">k </span>+/- <span style=\" font-style:italic;\">c </span>)</p><p>The Endpoints of its Conjugate axis are ( <span style=\" font-style:italic; color:#00da00;\">h </span>+/- <span style=\" font-style:italic;\">b </span>, <span style=\" font-style:italic; color:#0000ff;\">k</span>) <br/></p></body></html>"))
        self.label_56.setText(_translate("topicLessonMainWindow", "<html><head/><body><p>Additional Info:</p><p>- The center, foci and the vertices are all on the transverse axis.</p><p>- <span style=\" font-style:italic;\">a</span> is the distance from the center to each vertex. <span style=\" font-style:italic;\">c</span> is the distance from the center </p><p>to each focus. <span style=\" font-style:italic;\">b</span> is the distance from the center to an endpoint of the Conjugate axis. </p><p>- <span style=\" font-style:italic;\">c</span> &gt; <span style=\" font-style:italic;\">a</span> and <span style=\" font-style:italic;\">c</span><span style=\" font-size:18pt; font-weight:600; vertical-align:super;\">2</span> = <span style=\" font-style:italic;\">a</span><span style=\" font-size:18pt; font-weight:600; vertical-align:super;\">2</span> + <span style=\" font-style:italic;\">b</span><span style=\" font-size:18pt; font-weight:600; vertical-align:super;\">2</span></p></body></html>"))
