        self.label_119.setText(_translate("topicLessonMainWindow", "<html><head/><body><p>Examples of solving nonlinear equations using Elimination Method.</p></body></html>"))
        self.label_120.setText(_translate("topicLessonMainWindow", "<html><head/><body><p>Example 1:</p><p>Solve the nonlinear system:</p><p align=\"center\"><br/>(1) <span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">+ 4</span><span style=\" font-size:20pt; font-style:italic;\">x - y</span><span style=\" font-size:20pt;\"> = 7</span></p><p align=\"center\">(2) <span style=\" font-size:20pt;\">2</span><span style=\" font-size:20pt; font-style:italic;\">x</span><span style=\" font-size:20pt;\"> - </span><span style=\" font-size:20pt; font-style:italic;\">y</span><span style=\" font-size:20pt;\"> = -1</span></p><p>Solution:</p><p>- The variable <span style=\" font-style:italic;\">y</span> can be eliminated easily by subtraction: </p><p align=\"center\"><span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">+ 4</span><span style=\" font-size:20pt; font-style:italic;\">x - y</span><span style=\" font-size:20pt;\"> = 7</span></p><p align=\"center\"><span style=\" font-size:20pt; text-decoration: underline;\">-____2</span><span style=\" font-size:20pt; font-style:italic; text-decoration: underline;\">x</span><span style=\" font-size:20pt; text-decoration: underline;\"> - </span><span style=\" font-size:20pt; font-style:italic; text-decoration: underline;\">y</span><span style=\" font-size:20pt; text-decoration: underline;\"> = -1</span></p><p align=\"center\"><span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">+ 2</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt;\">= 8</span><br/></p><p>- 3<span style=\" font-style:italic;\">x</span><span style=\" font-size:18pt; font-weight:600; vertical-align:super;\">2</span>+ 2<span style=\" font-style:italic;\">x</span> = 8, will be used to solved the equation, from there.</p><p align=\"center\"><span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">+ 2</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt;\">= 8</span></p><p align=\"center\"><span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">+ 2</span><span style=\" font-size:20pt; font-style:italic;\">x - </span><span style=\" font-size:20pt;\">8 = 0</span><br/></p><p>- Factor out the similar variables and coefficients:</p><p align=\"center\"><span style=\" font-size:20pt;\">( </span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt;\">+ 2 )(3</span><span style=\" font-size:20pt; font-style:italic;\">x -</span><span style=\" font-size:20pt;\"> 4)= 0</span><br/></p><p>Therefore either <span style=\" color:#00da00;\">x = -2</span> or <span style=\" color:#0000ff;\">x = 4/3</span></p><p>when <span style=\" color:#00da00;\">x = -2</span>, y = 2 (<span style=\" color:#00da00;\">-2</span>) + 1<span style=\" font-size:18pt;\"> = </span>-3</p><p>when <span style=\" color:#0000ff;\">x = 4/3</span>, y = 2 (<span style=\" color:#0000ff;\">4/3</span>) + 1<span style=\" font-size:18pt;\"> = </span>8/3 + 3/3 = 11/3</p><p>The solution of the system is:</p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">S</span><span style=\" font-size:20pt;\"> = {( -2 , -3) , ( 4/3 , 11/3 )}</span></p><p><br/></p></body></html>"))
        self.label_121.setText(_translate("topicLessonMainWindow", "<html><head/><body><p>Example 2:</p><p>Solve the nonlinear system:</p><p align=\"center\"><br/>(1) <span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">- </span><span style=\" font-size:20pt; font-style:italic;\">y </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">= 11</span></p><p align=\"center\">(2) <span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\"> - 4</span><span style=\" font-size:20pt; font-style:italic;\">y </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\"> = 8</span></p><p>Solution:</p><p>- We can eliminate the variable <span style=\" font-style:italic;\">x</span> by multiplying the Equation(2) by -3: </p><p align=\"center\">(1) <span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">- </span><span style=\" font-size:20pt; font-style:italic;\">y </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">= 11</span></p><p align=\"center\">(2a) <span style=\" font-size:20pt;\">-3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\"> - 12</span><span style=\" font-size:20pt; font-style:italic;\">y </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\"> = -24</span><br/></p><p>- add the similar terms of Equation (1) and (2).</p><p align=\"center\"><span style=\" font-size:20pt; color:#ffffff;\">aaa</span><span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">- </span><span style=\" font-size:20pt; font-style:italic;\">y </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt; color:#ffffff;\">aaa</span><span style=\" font-size:20pt;\">= 11</span></p><p align=\"center\"><span style=\" font-size:20pt;\">+</span><span style=\" font-size:20pt; color:#ffffff;\">a</span><span style=\" font-size:20pt; text-decoration: underline;\">-3</span><span style=\" font-size:20pt; font-style:italic; text-decoration: underline;\">x </span><span style=\" font-size:20pt; font-style:italic; text-decoration: underline; vertical-align:super;\">2</span><span style=\" font-size:20pt; text-decoration: underline;\"> - 12</span><span style=\" font-size:20pt; font-style:italic; text-decoration: underline;\">y </span><span style=\" font-size:20pt; font-style:italic; text-decoration: underline; vertical-align:super;\">2</span><span style=\" font-size:20pt; text-decoration: underline;\"> = -24</span></p><p align=\"center\"><span style=\" font-size:20pt; color:#ffffff;\">aaaaaaa</span><span style=\" font-size:20pt;\">-13</span><span style=\" font-size:20pt; font-style:italic;\">y </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">= -13</span><br/></p><p>- divide both sides by -13 to remove the coeffcient of <span style=\" font-size:20pt; font-style:italic;\">y </span><span style=\" font-size:20pt; font-weight:600; font-style:italic; vertical-align:super;\">2</span>.</p><p align=\"center\"><span style=\" font-size:20pt; text-decoration: underline;\">-13</span><span style=\" font-size:20pt; font-style:italic; text-decoration: underline;\">y </span><span style=\" font-size:20pt; font-style:italic; text-decoration: underline; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">=</span><span style=\" font-size:20pt; text-decoration: underline;\"> -13</span></p><p align=\"center\"><span style=\" font-size:20pt; color:#ffffff;\">a</span><span style=\" font-size:20pt;\">-13</span><span style=\" font-size:20pt; color:#ffffff;\">aaaa</span><span style=\" font-size:20pt;\">-13</span></p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">y </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2</span><span style=\" font-size:20pt;\">= 1</span><br/></p><p>- move the constant term to the right, and make it into two binomials.</p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">y </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">- 1 = 0</span></p><p align=\"center\"><span style=\" font-size:20pt;\">( </span><span style=\" font-size:20pt; font-style:italic;\">y </span><span style=\" font-size:20pt;\">+ 1 )( </span><span style=\" font-size:20pt; font-style:italic;\">y </span><span style=\" font-size:20pt;\">- 1 ) = 0</span></p><p align=\"center\"><br/></p><p>- Therefore <span style=\" font-size:20pt;\">y = -1</span> and <span style=\" font-size:20pt;\">y = 1</span>, replace the <span style=\" font-style:italic;\">y</span> variable in the Equation (1).</p><p>- When <span style=\" font-size:20pt;\">y = -1</span>, </p><p align=\"center\"><span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">- </span><span style=\" font-size:20pt; font-style:italic; color:#0000ff;\">y </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">= 11</span></p><p align=\"center\"><span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">- (</span><span style=\" font-size:20pt; color:#0000ff;\">-1</span><span style=\" font-size:20pt;\">)</span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">= 11</span></p><p align=\"center\"><span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">= 12</span></p><p align=\"center\"><span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">- 12 = 0</span></p><p align=\"center\"><span style=\" font-size:20pt;\">3( </span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">- 4 ) = 0</span></p><p align=\"center\"><span style=\" font-size:20pt;\">3( </span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt;\">+ 2 )( </span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt;\">- 2 ) = 0</span><br/></p><p>- The value <span style=\" font-size:18pt; font-style:italic;\">y</span><span style=\" font-size:18pt;\"> = -1</span>, corresponds to two vales of <span style=\" font-size:18pt; font-style:italic;\">x</span>. <span style=\" font-size:18pt; font-style:italic;\">x = -2</span> and <span style=\" font-size:18pt; font-style:italic;\">x = 2</span>. This tells that two graphs representing</p><p>the equations in the system pass through points ( -2, -1 ) and ( 2, -1 ).</p><p>- When <span style=\" font-size:20pt;\">y = 1</span>, </p><p align=\"center\"><span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">- </span><span style=\" font-size:20pt; font-style:italic; color:#0000ff;\">y </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">= 11</span></p><p align=\"center\"><span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">- (</span><span style=\" font-size:20pt; color:#0000ff;\">1</span><span style=\" font-size:20pt;\">)</span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">= 11</span></p><p align=\"center\"><span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">= 12</span></p><p align=\"center\"><span style=\" font-size:20pt;\">3</span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">- 12 = 0</span></p><p align=\"center\"><span style=\" font-size:20pt;\">3( </span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt; font-style:italic; vertical-align:super;\">2 </span><span style=\" font-size:20pt;\">- 4 ) = 0</span></p><p align=\"center\"><span style=\" font-size:20pt;\">3( </span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt;\">+ 2 )( </span><span style=\" font-size:20pt; font-style:italic;\">x </span><span style=\" font-size:20pt;\">- 2 ) = 0</span><br/></p><p>- The value <span style=\" font-size:18pt; font-style:italic;\">y</span><span style=\" font-size:18pt;\"> = 1</span>, corresponds to two vales of <span style=\" font-size:18pt; font-style:italic;\">x</span>. <span style=\" font-size:18pt; font-style:italic;\">x = -2</span> and <span style=\" font-size:18pt; font-style:italic;\">x = 2</span>. This tells that two graphs representing</p><p>the equations in the system pass through points ( -2, -1 ) and ( 2, -1 )</p><p><br/></p><p>The solution of the system is:</p><p align=\"center\"><span style=\" font-size:20pt; font-style:italic;\">S</span><span style=\" font-size:20pt;\"> = {( 2 , -1 ) , ( -2 , -1) , ( 2 , 1 ) , ( -2 , 1 )}</span></p><p><br/></p></body></html>"))
